import './App.css';

function Header() {
  return (
    <header className="header">
      <nav className="navbar navbar-expand-lg navbar-dark bg-transparent">
        <a className="navbar-brand" href="#">Portfolio.</a>
        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav ml-auto">
            <li className="nav-item">
              <a className="nav-link" href="#">Home</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#">About</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#">Skills</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#">Projects</a>
            </li>
          </ul>
        </div>
      </nav>
    </header>
  );
}

function Introdiv() {
  return (
    <div className="matter text-center">
      <h3>Hello, It's Me</h3>
      <h1>Mohan Satya Prasad</h1>
      <h3>And I'm a <span>Frontend Developer</span></h3>
      <p>Actually now I am practicing React.js that's why I made this.</p>

      <div className="socialmedia">
        <a href="#"><i className="fab fa-facebook"></i></a>
        <a href="#"><i className="fab fa-instagram"></i></a>
        <a href="#"><i className="fab fa-linkedin"></i></a>
        <a href="#"><i className="fab fa-twitter"></i></a>
      </div>

      <a href="#" className="btn btn-primary">View my Resume</a>
    </div>
  );
}

function Imagediv() {
  return (
    <div className="homeimg">
      <div className="photodiv"></div>
      <img src="port11.png" alt="msp" className="myimg img-fluid" />
    </div>
  );
}

function Body() {
  return (
    <section className="home container">
      <div className="row">
        <div className="col-md-6">
          <Introdiv />
        </div>
        <div className="col-md-6">
          <Imagediv />
        </div>
      </div>
    </section>
  );
}

function App() {
  return (
    <div className='App'>
      <Header />
      <Body />
    </div>
  );
}

export default App;
